import React, { useState, useEffect } from "react";
import { groupBy } from "lodash";

export default function BuyOrderBook(props) {
	const buyOrders = props.buyOrders
		.filter((a) =>
			typeof a != "undefined"
				? a.celebrityToken ==
						(typeof props.token[0] != "undefined"
							? props.token[0].address
							: null) &&
				  (a.status == 0 || a.status == 1)
				: null
		)
		.sort((a, b) => b.buyPrice - a.buyPrice);

	const groups = groupBy(buyOrders, "price");
	console.log(groups);
	return (
		<React.Fragment>
			{typeof groups != "undefined"
				? groups[0].map((order, index) => {
						return (
							<tr key={index}>
								<td>
									{typeof order != "undefined"
										? order.tokensLeftToBuy / 10 ** 18
										: null}
								</td>
								<td style={{ color: "#55bd6c" }}>
									{typeof order != "undefined"
										? order.buyPrice / 10 ** 18
										: null}
								</td>
							</tr>
						);
				  })
				: null}
		</React.Fragment>
	);
}
